import React, { useState } from "react";
import { Link } from "react-router-dom";
import { ReactComponent as SvgA } from './Asysmbol.svg';


function SideIcons(props) {
    const [color, setColor] = useState({ color: "var(--secondary-color)" });
    var name = props.name;
    if (props.type == "text") {
        return (
            <li className="navbar-item">
                <Link to={"/" + props.name}>
                    <a className="side-icons-text" style={color} onClick={window.location.pathname == ("/" + props.name) ?
                        setColor({ color: "var(--secondary-color)" }) :
                        setColor({ color: "var(--secondary-color)" })} >
                        {props.name}
                    </a>
                </Link>

            </li >
        );
    }
    else if (props.type === "head") {
        return (
            <Link to={"/"}>
                <SvgA className="navLogo" id={window.location.pathname == ("/" + props.name) ? "active" : ""} onClick={this.forceUpdate()} />
            </Link>

        );
    }
}

export default SideIcons;
